import React from 'react';
import './ImageLinkForm.css'
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';

const ImageLinkForm = ({onInputChange, onButtonSubmit}) => {
    return (

        <div >
            <p className='f3'>
                {'Let\'s identify ingredients'}
            </p>
            <div className='center'>
            <div className='pa2 ba ma4 bw2 br3 form shadow-5'>
                <TextField id="standard-search" className='f4 pa2 w-70 center' type="search" onChange={onInputChange}/>
                <Button variant="contained" color="secondary"
                onClick={onButtonSubmit}
                className='w-20 grow f4 link ph3 pv2 dib white'>Detect</Button>
            </div>
            </div>
        </div>
    )
}

export default ImageLinkForm;
